/*Table structure for table `feedback` */

DROP TABLE IF EXISTS `feedback`;

CREATE TABLE `feedback` (
  `feedback_id` int(11) NOT NULL AUTO_INCREMENT,
  `feedback_name` varchar(25) NOT NULL,
  `feedback_content` varchar(1000) NOT NULL,
  PRIMARY KEY (`feedback_id`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8mb4;

/*Data for the table `feedback` */

insert  into `feedback`(`feedback_id`,`feedback_name`,`feedback_content`) values 
(1,'Harshan','Very nice presentation ');

/*Table structure for table `user_registration` */

DROP TABLE IF EXISTS `user_registration`;

CREATE TABLE `user_registration` (
  `user_registration_id` int(11) NOT NULL AUTO_INCREMENT,
  `user_registration_name` varchar(25) NOT NULL,
  `user_registration_age` date NOT NULL,
  `user_registration_address` varchar(100) NOT NULL,
  `user_registration_phone_no` varchar(20) NOT NULL,
  `user_registration_email` varchar(30) NOT NULL,
  `user_registration_location` varchar(25) NOT NULL,
  `user_registration_password` varchar(12) NOT NULL,
  `user_registration_gender` varchar(10) NOT NULL,
  `user_registration_pic` longblob DEFAULT NULL,
  PRIMARY KEY (`user_registration_id`)
) ENGINE=InnoDB AUTO_INCREMENT=51 DEFAULT CHARSET=utf8mb4;

